import React from 'react';

import classes from './Movie.module.css';

const Movie = (props) => {
  return (
    <li className={classes.movie}>
      <h2>{props.name}</h2>
      <h3>Height in cm:{props.height}</h3>
      <h4>Birth year: {props.year}</h4>
      <p>kg:{props.mass}</p>
      <p>{props.hair}</p>
      <p>{props.eye}</p>
      <p>{props.skin}</p>
    </li>
  );
};

export default Movie;
